import React from 'react'

import './Header.css'
import { Button } from 'rsuite'

export default function Header() {
    return (
        <div>
            <p>Roitinfo</p>
            <Button appearance="primary">Articoli</Button>
            <Button appearance="primary">Login</Button>
        </div>
    )
}
